package rates

import (
	"testing"
	"time"
)

func TestCalcRate(t *testing.T) {
	tests := map[string]struct {
		rateInfo RateInfo
		expected float64
	}{
		"Arbitrary 1s": {
			rateInfo: RateInfo{ShapeFile: "Arbitrary.shp", Records: 500, Rows: map[string]int{"tg": 500}, Duration: time.Second},
			expected: 500,
		},
		"Arbitrary < 1s": {
			rateInfo: RateInfo{ShapeFile: "Arbitrary.shp", Records: 1, Rows: map[string]int{"tg": 500}, Duration: time.Millisecond * 500},
			expected: 2,
		},
		"TG_RailwayTunnel": {
			rateInfo: RateInfo{ShapeFile: "/TG_RailwayTunnel.shp", Records: 1, Rows: map[string]int{"tg": 1}, Duration: 804431},
			expected: 1243.1146984638833,
		},
		"TG_Road": {
			rateInfo: RateInfo{ShapeFile: "TG_Road.shp", Records: 31355, Rows: map[string]int{"tf": 44, "tg": 31877, "tm": 70}, Duration: 9050391018},
			expected: 3464.4911957548748,
		},
	}

	for name, test := range tests {
		actual := calcRate(test.rateInfo)

		if test.expected != actual {
			t.Errorf("%v expected %v, got %v", name, test.expected, actual)
		}
	}
}

func TestCalcRates(t *testing.T) {
	tests := map[string]struct {
		ratesInfo      []RateInfo
		importDuration time.Duration
		rowsGenerated  int
		averageRate    int
		maxRate        int
		actualRate     int
	}{
		"TG sequential": {
			ratesInfo:      ratesInfoTestData["TG Sequential"],
			importDuration: time.Minute,
			rowsGenerated:  120506,
			averageRate:    8674,
			maxRate:        17088,
			actualRate:     1964,
		},
		"TG concurrent": {
			ratesInfo:      ratesInfoTestData["TG Concurrent"],
			importDuration: time.Minute,
			rowsGenerated:  120506,
			averageRate:    1025,
			maxRate:        3464,
			actualRate:     1964,
		},
		"ALL Complete": {
			ratesInfo:      ratesInfoTestData["ALL"],
			importDuration: time.Hour,
			rowsGenerated:  15987431,
			averageRate:    754,
			maxRate:        5322,
			actualRate:     4368,
		},
	}

	for name, test := range tests {
		var rowsGenerated = CalcRowsGenerated(test.ratesInfo)
		averageRate := CalcAvgRate(test.ratesInfo)
		maxRate := CalcMaxRate(test.ratesInfo)
		actualRate := CalcActualRate(test.ratesInfo, test.importDuration)

		if test.rowsGenerated != rowsGenerated {
			t.Errorf("%v rowsGenerated expected %v, got %v", name, test.rowsGenerated, rowsGenerated)
		}
		if test.averageRate != averageRate {
			t.Errorf("%v averageRate expected %v, got %v", name, test.averageRate, averageRate)
		}
		if test.maxRate != maxRate {
			t.Errorf("%v maxRate expected %v, got %v", name, test.maxRate, maxRate)
		}
		if test.actualRate != actualRate {
			t.Errorf("%v actualRate expected %v, got %v", name, test.actualRate, actualRate)
		}
	}
}

